import React from 'react'
import './Movie_card.css';

const Movie_card=({movie:{title,date,description,poster,rate}})=>{
  return(
<div className='card'>
  <div className='movie'>
    <div className='title'>
    <h1>{title}</h1>
    </div>
  </div>
</div>

)
};
export default Movie_card;
